pub enum ClientResponse {

    /// A regular JSON-RPC request output (single response).
    Output(jsonrpc_core::Output),

    /// A notification.
    Notification(jsonrpc_core::Notification),
}

pub enum RpcError {

    /// An error returned by the server.
    #[display(fmt = "Server returned rpc error {}", _0)]
    JsonRpcError(Error),

    /// Failure to parse server response.
    #[display(fmt = "Failed to parse server response as {}: {}", _0, _1)]
    ParseError(String, Box<std::error::Error + Send>),

    /// Request timed out.
    #[display(fmt = "Request timed out")]
    Timeout,

    /// A general client error.
    #[display(fmt = "Client error: {}", _0)]
    Client(String),

    /// Not rpc specific errors.
    #[display(fmt = "{}", _0)]
    Other(Box<std::error::Error + Send>),
}
